INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3700365097338', 'SDW Tomme de brebis  confiture de coing', 'Pain de mie au blé malté 52% (farine de blé, eau, flocon de blé malté toasté, graines (tournesol, millet, pavot, lin brun), gluten de blé, huile de colza, flocons de seigle malté, sel, levure, dextrose vinaigre d\'alcool, sucre, émulsifiants E471 et E472e, farine d\'orge malté toasté, malté torréfié, arôme naturel, agent de traitement de la farine E300) préparation à base de pois chiches 11% (pois chiches 8,9% (pois chiches 8,9%, eau, sel), huile de colza, jus de citron concentré, sel, ail, épices) roquette fromage au lait pasteurisé à pâte filée fumé &quot;scamorza&quot; 8,5% pois chiche 5% (pois chiches secs trempés, eau, sel, arôme naturel) tomate 3,9% - beurre échalote préparation à base de tomate 0,7% (jus concentré de tomate, sucre, huile de tournesol) - persil huile vierge de sésame amidon modifié - harissa (piment rouge fort, ail, coriandre, sel, carvi). Peut contenir : céleri, moutarde, oeufs, soja, poissons, arachides, crustacés, sulfites, lupin, fruits à coque mollusques,', 'https://static.openfoodfacts.org/images/products/370/036/509/7338/front_fr.4.400.jpg', '16.8', '7.4', '26.2', '3.7', '', '10.7', '1', '0.393700787401575', '', '0');

